public class InnerRuleGroupStatementFactory(Action<Humidifier.WAFv2.RuleGroupTypes.Statement> factoryAction = null) : SubResourceFactory<Humidifier.WAFv2.RuleGroupTypes.Statement>
{

    internal InnerRuleGroupSizeConstraintStatementFactory SizeConstraintStatementFactory { get; set; }

    internal InnerRuleGroupAndStatementFactory AndStatementFactory { get; set; }

    internal InnerRuleGroupXssMatchStatementFactory XssMatchStatementFactory { get; set; }

    internal InnerRuleGroupNotStatementFactory NotStatementFactory { get; set; }

    internal InnerRuleGroupByteMatchStatementFactory ByteMatchStatementFactory { get; set; }

    internal InnerRuleGroupRateBasedStatementFactory RateBasedStatementFactory { get; set; }

    internal InnerRuleGroupGeoMatchStatementFactory GeoMatchStatementFactory { get; set; }

    internal InnerRuleGroupLabelMatchStatementFactory LabelMatchStatementFactory { get; set; }

    internal InnerRuleGroupRegexMatchStatementFactory RegexMatchStatementFactory { get; set; }

    internal InnerRuleGroupSqliMatchStatementFactory SqliMatchStatementFactory { get; set; }

    internal InnerRuleGroupRegexPatternSetReferenceStatementFactory RegexPatternSetReferenceStatementFactory { get; set; }

    internal InnerRuleGroupOrStatementFactory OrStatementFactory { get; set; }

    internal InnerRuleGroupIPSetReferenceStatementFactory IPSetReferenceStatementFactory { get; set; }

    protected override Humidifier.WAFv2.RuleGroupTypes.Statement Create()
    {
        var statementResult = CreateStatement();
        factoryAction?.Invoke(statementResult);

        return statementResult;
    }

    private Humidifier.WAFv2.RuleGroupTypes.Statement CreateStatement()
    {
        var statementResult = new Humidifier.WAFv2.RuleGroupTypes.Statement();

        return statementResult;
    }
    public override void CreateChildren(Humidifier.WAFv2.RuleGroupTypes.Statement result)
    {
        base.CreateChildren(result);

        result.SizeConstraintStatement ??= SizeConstraintStatementFactory?.Build();
        result.AndStatement ??= AndStatementFactory?.Build();
        result.XssMatchStatement ??= XssMatchStatementFactory?.Build();
        result.NotStatement ??= NotStatementFactory?.Build();
        result.ByteMatchStatement ??= ByteMatchStatementFactory?.Build();
        result.RateBasedStatement ??= RateBasedStatementFactory?.Build();
        result.GeoMatchStatement ??= GeoMatchStatementFactory?.Build();
        result.LabelMatchStatement ??= LabelMatchStatementFactory?.Build();
        result.RegexMatchStatement ??= RegexMatchStatementFactory?.Build();
        result.SqliMatchStatement ??= SqliMatchStatementFactory?.Build();
        result.RegexPatternSetReferenceStatement ??= RegexPatternSetReferenceStatementFactory?.Build();
        result.OrStatement ??= OrStatementFactory?.Build();
        result.IPSetReferenceStatement ??= IPSetReferenceStatementFactory?.Build();
    }

} // End Of Class

